import React, { useState } from "react";
import { Link } from "react-router-dom";
import { useLanguage } from "../LanguageSource";
import "../index.css";
import "../styles/navbar.css";
import terminal from "../img/terminal.png";

const Navbar = () => {
  const { currentLanguage, translations } = useLanguage();
  return (
    <nav className="block w-screen px-6 py-3 text-black bg-sky-600 shadow-2xl border-4 border-cyan-500/100 bg-opacity-80 backdrop-blur-2xl backdrop-saturate-200">
      <div className="flex items-center justify-between text-blue-gray-900">
        <img
          alt="Terminal"
          className="h-12 hover:cursor-pointer w-auto mr-20"
          src={terminal}
        />
        {/* <div className=" lg:block"> */}
        <ul className="flex flex-nowrap my-2 gap-2 lg:mb-0 lg:mt-0 lg:flex-row lg:items-center lg:gap-6">
          <li className="block p-1 font-medium leading-normal text-blue-gray-900">
            <Link
              className="mr-20 cursor-pointer py-1.5 text-base tracking-wider flex items-center transition-colors rounded-lg p-2 hover:text-cyan-300 hover:bg-gray-700"
              as={Link}
              to="/"
            >
              {translations[currentLanguage].home}
            </Link>
          </li>
          <li className="block p-1 font-medium leading-normal text-blue-gray-900">
            <Link
              className="mr-20 cursor-pointer py-1.5 text-base tracking-wider flex items-center transition-colors rounded-lg p-2 hover:text-cyan-300 hover:bg-gray-700"
              as={Link}
              to="/"
            >
              GitHub
            </Link>
          </li>
          <li className="block p-1 font-medium leading-normal text-blue-gray-900">
            <Link
              className="mr-20 cursor-pointer py-1.5 text-base tracking-wider flex items-center transition-colors rounded-lg p-2 hover:text-cyan-300 hover:bg-gray-700"
              as={Link}
              to="/"
            >
              LinkedIn
            </Link>
          </li>
          <li className="block p-1 font-medium leading-normal text-blue-gray-900">
            <Link
              className="mr-20 cursor-pointer py-1.5 text-base tracking-wider flex items-center transition-colors "
              as={Link}
              to="/"
            >
              {translations[currentLanguage].getInTouch}
            </Link>
          </li>
        </ul>
        {/* </div> */}
      </div>
    </nav>
  );
};

export default Navbar;
